import React from 'react';
import '../Styles/Navbar.css';
import {NavLink} from 'react-router-dom';

function NavBar() {
  return (
        <> 
        <nav className="navbar">
          <NavLink exact to='/' className="nav-logo">
              AnywhereFitness
          </NavLink>
        </nav>
        </>
    )
}

export default NavBar
